@mysteryfancy

Some months ago i requested from a tpb admin to block catshit's IP or delete his account from their database.A few weeks ago i finally received the following answer :"Dear Jimstalk,thanks for informing us on time.Our team has checked your issue and we succesfully blocked the user catshit1 from our account database.The reason is:user misconduct,abuse,spamming,bad language.Unfortunately there is no permanent ban in such cases which means that this account will be reopened soon.Thank you for keeping our community clean.Please let us know for other problems.

ThePirateBay Group"
